import React, {useState} from 'react';
import {Routes, Route, Link} from "react-router-dom";

import './App.css';
import Props from './pages/props';

function App() {
  const [number, setNumber] = useState(1);

  return (
    <div className="App">
      <nav>
        <Link to="/">Props Home</Link>
      </nav>
      <h1>Root : {number}</h1>
      <Routes>
        <Route path='/' element={
          <Props 
            number = {number}
            onIncrease = {() => {
              setNumber(number +1);
            }}
          />
        } />
        <Route path="/" element={<Home />} />
      </Routes>
    </div>
  );
}

export default App;
